import CitySearch from './CitySearch';

class App extends Component {

    constructor(props){
        super(props);
        this.state = {
            city: undefined,
            temperature: undefined
        }        
    }

    componentDidMount() {
        // this.callAPI();
    }

    render () {
        return (
            <div className="App">
                <CitySearch 
                    onSearchComplete={this.handleSearch}
                />
                <p>{this.state.temperature}</p>
            </div>
        );
    }
}

export default App;
